import React, { Component } from 'react'
import axios from 'axios'

export default class Home extends Component {
   
    getTrending= async ()=>{
      let x= await axios.get(`https://api.themoviedb.org/3/movie/550?api_key=896e8f1d1bbca56d402bb80f5b1bae2c`)
   
      console.log(x);

    }
    componentDidMount(){
        this.getTrending()
    }

    render() {
        return (
           <>
            <div className="container my-5">
                <div className="row">
                {this.movies.map((value , index)=>{
                    return(
                        <div key={index} className="col-md-2">
                            <div className="item">
                            <img src="" alt="" />
                            <h2></h2>
                            <p></p>

                            </div>
                        </div>
                    )
                })}
                </div>
            </div>
           </>
        )
    }
}
